    $newid = insert_record('role_capabilities',(object) $item);
    if($newid != $item['id']) {
        if(!set_field('role_capabilities', 'id', $item['id'], 'id', $newid)) {
            print "Could not change id from $newid to {$item['id']}<br>\n";
